import React from "react";
import {Container} from 'react-bootstrap'

let cardFood = ({item}) => {
    return (
        <div>
            <div className="foodCart">
                <Container>
                    <div className="content">
                        {
                            item.map()
                        }
                    </div>
                </Container>
            </div>
        </div>
    )
}

export default cardFood
